def entrance(lst):
    n = len(lst)
    res = []
    for i in range(n):
        is_subset = any((all((item not in lst[j].items() for item in lst[i].items())) for j in range(n) if j != i))
        if not is_subset:
            res.append(lst[i])
    return res
